import React from "react"
import { Container } from "./contants"

const API = [
  {
    name: "AgentID",
    value: 26644,
  },
  {
    name: "AgentName",
    value: "my.nguyen.44",
  },
  {
    name: "Agent_Extension",
    value: 26644,
  },
  {
    name: "Agent_Hangup_Status",
    value: "False",
  },
]
const Metadata = () => {
  return <Container>Metadata</Container>
}

export default Metadata
